import React, {Component} from "react";

class UserRegister extends Component {
    state = {
        register: {}
    };
    render() {
        const {register} = this.state;
        return(
            <center>
                <h1>Register</h1>
                <input placeholder="Enter Email" value={register.email ?? ""}/><br /><br />
                <input placeholder="Enter Password" value={register.password ?? ""}/><br /><br />
                <input placeholder="Enter Confirm Password" value={register.confirmPassword ?? ""}/><br /><br />
            </center>
        )
    }
}

export default UserRegister;
